import React from "react";
import "./wyniki.css";
import NewForm from "./Form";
import Card from "../UI/Card";

function Wyniki(props) {
  const wynikImie = props.imie;
  const wynikWiek = props.wiek;

  console.log(wynikImie);
  console.log(wynikWiek);
  return (
    <li>
      <div>
        <Card>
          <NewForm onSaveDate={Wyniki} />
        </Card>
        <div>
          <Card>
            <p> {
              title={wynikImie},
              chuj={wynikWiek}

              } </p>
            <p> {wynikWiek} </p>
          </Card>
        </div>
      </div>
    </li>
  );
}

export default Wyniki;
